import React from "react";
import { PageContainer, Overlay, Title, Subtitle } from "./index_style.js";

function Home() {
  return (
    <PageContainer>
      <Overlay />
      <Title>MARview</Title>
      <Subtitle>The Future of Maritime Navigation</Subtitle>
    </PageContainer>
  );
}

export default Home;
